Процедура ВывестиОписаниеИзменений(Знач НомерВерсии, ДокументОписаниеОбновлений, МакетОписаниеОбновлений)

	Если Прав( НомерВерсии, 2 ) = ".0" Тогда
		Номер = Лев(НомерВерсии, СтрДлина(НомерВерсии)-2);
	Иначе
		Номер = НомерВерсии;
	КонецЕсли;
	Номер = СтрЗаменить(Номер, ".", "_");

Функция ВесВерсииИзМассиваСтрок(РазрядыВерсииСтроками)
Возврат 0 + Число(РазрядыВерсииСтроками[0]) * 1000000000 + Число(РазрядыВерсииСтроками[1]) * 1000000 + Число(РазрядыВерсииСтроками[2]) * 1000 + Число(РазрядыВерсииСтроками[3]);
КонецФункции

Функция ВесВерсииИзМассиваСтрок(РазрядыВерсииСтроками)
Пока РазрядыВерсииСтроками.Количество() < 5 Цикл РазрядыВерсииСтроками.Добавить("0"); КонецЦикла;
Возврат 0 + Число(РазрядыВерсииСтроками[0]) * 1000000000000 + Число(РазрядыВерсииСтроками[1]) * 1000000000 + Число(РазрядыВерсииСтроками[2]) * 1000000 + Число(РазрядыВерсииСтроками[3]) * 1000 + Число(РазрядыВерсииСтроками[4]);
КонецФункции

Если ОписаниеПодсистемы.Имя = ИмяОсновнойКонфигурации Тогда
	ИтерацияОбновлениеОсновнойПодсистемы = ИтерацияОбновления;
КонецЕсли;

Если ОписаниеПодсистемы.Имя = ИмяОсновнойКонфигурации Тогда
	ОбновлениеИнформационнойБазыДМ.ИзменитьРазрядностьНомеровВерсийДляОбработчиков( ИтерацияОбновления.Обработчики );
	ИтерацияОбновлениеОсновнойПодсистемы = ИтерацияОбновления;
КонецЕсли;

Пока РазрядыВерсииСтроками.Количество() < 5 Цикл
	РазрядыВерсииСтроками.Добавить("0");
КонецЦикла;
Если РазрядыВерсииСтроками.Количество() > 5 Тогда

Если Версия1.Количество() <> 4 Тогда
	ВызватьИсключение СтроковыеФункцииКлиентСервер.ПодставитьПараметрыВСтроку(
		НСтр("ru = 'Неправильный формат параметра СтрокаВерсии1: %1'"), СтрокаВерсии1);
КонецЕсли;
Версия2 = СтрРазделить(Строка2, ".");
Если Версия2.Количество() <> 4 Тогда

Если Версия1.Количество() < 4 Тогда
	ВызватьИсключение СтроковыеФункцииКлиентСервер.ПодставитьПараметрыВСтроку(
		НСтр("ru = 'Неправильный формат параметра СтрокаВерсии1: %1'"), СтрокаВерсии1);
КонецЕсли;
Версия2 = СтрРазделить(Строка2, ".");
Если Версия2.Количество() < 4 Тогда

			ВыполнитьОчисткуЖурналаРегистрацииСостоянийЗаявокНаОформлениеОпераций(Выборка.СрокХраненияДанных);

		КонецЕсли;

	КонецЦикла;

		ДМ_ИнтеграцияВетисAPIСервер.ЗарегистрироватьУспешноеВыполнениеРегЗадания( "ОчисткаЖурналовЗагрузкиДанных" );
	Исключение
		лОписаниеОшибки = ОписаниеОшибки();
		ДМ_ИнтеграцияВетисAPIСервер.ЗарегистрироватьОшибкуВыполненияРегЗадания( "ОчисткаЖурналовЗагрузкиДанных", лОписаниеОшибки );
		ВызватьИсключение;
	КонецПопытки

